Call parameters are: Amount; Asset ID; Gas forwarded. You can use these to forward coins to a contract. You can configure these parameters by creating an instance of CallParameters and passing it to a chain method called call_params. For instance, suppose the following contract that uses Sway's msg_amount() to return the amount sent in that transaction. fn get_msg_amount() -> u64 { msg_amount() } Then, in Rust, after setting up and deploying the above contract, you can configure the amount being sent in the transaction like this: let tx_params = TxParameters::default(); // Forward 1_000_000 coin amount of base asset_id // this is a big number for checking that amount can be a u64 let call_params = CallParameters::new(Some(1_000_000), None, None); let response = contract_instance .get_msg_amount() // Our contract method. .tx_params(tx_params) // Chain the tx params setting method. .call_params(call_params) // Chain the call params setting method. .call() // Perform the contract call. .await?; You can also use CallParameters::default() to use the default values: // Limit for the actual contract call
pub const DEFAULT_FORWARDED_GAS: u64 = 1_000_000;
// Lower limit when querying spendable UTXOs
pub const DEFAULT_SPENDABLE_COIN_AMOUNT: u64 = 1_000_000;
// Bytes representation of the asset ID of the "base" asset used for gas fees.
pub const BASE_ASSET_ID: AssetId = AssetId::new([0u8; 32]); This way: let response = contract_instance .initialize_counter(42) .call_params(CallParameters::default()) .call() .await?; The gas_forwarded parameter defines the limit for the actual contract call as opposed to the gas limit for the whole transaction. This means that it is constrained by the transaction limit. If it is set to an amount greater than the available gas, all available gas will be forwarded. // Set the transaction `gas_limit` to 1000 and `gas_forwarded` to 200 to specify that the // contract call transaction may consume up to 1000 gas, while the actual call may only use 200 // gas let tx_params = TxParameters::new(None, Some(1000), None, None); let call_params = CallParameters::new(None, None, Some(200)); let response = contract_instance .get_msg_amount() // Our contract method. .tx_params(tx_params) // Chain the tx params setting method. .call_params(call_params) // Chain the call params setting method. .call() // Perform the contract call. .await?;

